function setClickAction(tg, action){
 $(tg).bind("click keydown", function(e){
  var doClickWork=false;
  switch(e.type){
   case "click":
    doClickWork=true;
   break;
   case "keydown":
    if(e.keyCode == 13){
     e.preventDefault(); // click 이벤트 중복 발생 방지
     doClickWork=true;
    }
   break;
  }

  if(doClickWork){
   action(e,$(e.target));
  }
 });
}

