function fwriteTwitter(linkUrl, strMsg) {
    window.open("https://twitter.com/intent/tweet?url=" + encodeURIComponent(_LMAppUrlM + linkUrl) + "&text=" + encodeURIComponent(strMsg)).focus();
}
function fwriteFacebook(strMsg,linkUrl) {
	if($('#imgBigImg') != null) {
		$('#facebook_img').attr('src', $('#imgBigImg').attr('src') );
	}
    window.open("https://m.facebook.com/sharer.php?u=" + encodeURIComponent(_LMAppUrlM + '/' + linkUrl) + "&t=" + encodeURIComponent(strMsg));
}


