function goProductDetailLotteAndroidApp(cateId,prodCd,popupYn,socialSeq){
    document.location.href = "lottemartmobileapp://shopping/return_url="+_LMAppUrlM+"/mobile/cate/PMWMCAT0004_New.do?CategoryID="+cateId+"&ProductCD="+prodCd+"&socialSeq="+socialSeq;
}

function goProductDetailLotteIphoneApp(cateId,prodCd,popupYn,socialSeq){
    /*document.location.href = "lottemart-shopping-iphone://goURL="+_LMAppUrlM+"/mobile/cate/PMWMCAT0004_New.do?CategoryID="+cateId+"&ProductCD="+prodCd+"&socialSeq="+socialSeq;*/
	document.location.href = _LMAppUrlM+"/mobile/cate/PMWMCAT0004_New.do?CategoryID="+cateId+"&ProductCD="+prodCd+"&socialSeq="+socialSeq;
}

function goProductDetailToyAndroid(cateId,prodCd){
    document.location.href = "toysrus-shopping-android://shopping/return_url=http://m.toysrus.lottemart.com/mobile/cate/ProductDetail.do?CategoryID="+cateId+"&ProductCD="+prodCd;
}

function goProductDetailToyIphone(cateId,prodCd){
    /*document.location.href = "toysrus-shopping-iphone://goURL=http://m.toysrus.lottemart.com/mobile/cate/ProductDetail.do?CategoryID="+cateId+"&ProductCD="+prodCd;*/
	document.location.href = "http://m.toysrus.lottemart.com/mobile/cate/ProductDetail.do?CategoryID="+cateId+"&ProductCD="+prodCd;
}

function goProductDetailToy(cateId,prodCd){
    if( cateId == undefined || cateId == "" || prodCd == undefined || prodCd == "" ){
        alert('잘롯된 상품정보 입니다.');
        return false;
    }
    
    document.location.href = "http://m.toysrus.lottemart.com/mobile/cate/ProductDetail.do?CategoryID="+cateId+"&ProductCD="+prodCd;
}
